import React, { Component } from 'react'

export default class Vote extends Component {
  constructor() {
    super()
    this.state = {
      clicked: false
    }
  }

  render() {
    return (
      <div>
        <button onClick={this.setState({ clicked: true })}>&#8593;</button>
      </div>
    )
  }
}
